Rust supports generics, which lets you abstract algorithms or data structures (such as sorting or a binary tree) over the types used or stored. /// Pick `even` or `odd` depending on the value of `n`.
fn pick<T>(n: i32, even: T, odd: T) -> T { if n % 2 == 0 { even } else { odd }
} fn main() { println!("picked a number: {:?}", pick(97, 222, 333)); println!("picked a tuple: {:?}", pick(28, ("dog", 1), ("cat", 2)));
