Runtime errors like connection-refused or file-not-found are handled with the Result type, but matching this type on every call can be cumbersome. The try-operator ? is used to return errors to the caller. It lets you turn the common match some_expression { Ok(value) => value, Err(err) => return Err(err),
} è½¬æ¢æˆæ›´ç®€å•çš„å‘½ä»¤ some_expression? We can use this to simplify our error handling code: use std::io::Read;
use std::{fs, io}; fn read_username(path: &str) -> Result<String, io::Error> { let username_file_result = fs::File::open(path); let mut username_file = match username_file_result { Ok(file) => file, Err(err) => return Err(err), }; let mut username = String::new(); match username_file.read_to_string(&mut username) { Ok(_) => Ok(username), Err(err) => Err(err), }
} fn main() { //fs::write("config.dat", "alice").unwrap(); let username = read_username("config.dat"); println!("username or error: {username:?}");
} ç®€åŒ– read_username å‡½æ•°ä»¥ä½¿ç”¨ ?ã€‚ å…³é”®ç‚¹ï¼š username å˜é‡å¯ä»¥æ˜¯ Ok(string) æˆ– Err(error)ã€‚ å¯ä»¥ä½¿ç”¨ fs::write è°ƒç”¨æ¥æµ‹è¯•ä¸åŒçš„åœºæ™¯ï¼šæ²¡æœ‰æ–‡ä»¶ã€ç©ºæ–‡ä»¶ã€åŒ…å«ç”¨æˆ·åçš„æ–‡ä»¶ã€‚ Note that main can return a Result<(), E> as long as it implements std::process::Termination. In practice, this means that E implements Debug. The executable will print the Err variant and return a nonzero exit status on error.

