} The self arguments specify the "receiver" - the object the method acts on. There are several common receivers for a method: â€œ&selfâ€ï¼šä½¿ç”¨ä¸å¯å˜çš„å…±äº«å¼•ç”¨ä»è°ƒç”¨æ–¹å€Ÿç”¨å¯¹è±¡ã€‚ä¹‹åå¯ä»¥å†æ¬¡ä½¿ç”¨è¯¥å¯¹è±¡ã€‚ â€œ&mut selfâ€ï¼šä½¿ç”¨å”¯ä¸€çš„å¯å˜å¼•ç”¨ä»è°ƒç”¨æ–¹å€Ÿç”¨å¯¹è±¡ã€‚ä¹‹åå¯ä»¥å†æ¬¡ä½¿ç”¨è¯¥å¯¹è±¡ã€‚ â€œselfâ€ï¼šè·å–å¯¹è±¡çš„æ‰€æœ‰æƒå¹¶å°†å…¶ä»è°ƒç”¨æ–¹ç§»å‡ºã€‚è¯¥æ–¹æ³•ä¼šæˆä¸ºå¯¹è±¡çš„æ‰€æœ‰è€…ã€‚é™¤éæ˜ç¡®è½¬ç§»å¯¹è±¡çš„æ‰€æœ‰æƒï¼Œå¦åˆ™åœ¨è¯¥æ–¹æ³•è¿”å›æ—¶ï¼Œå¯¹è±¡å°†è¢«ä¸¢å¼ƒï¼ˆå–æ¶ˆåˆ†é…ï¼‰ã€‚å…·å¤‡å®Œå…¨æ‰€æœ‰æƒï¼Œä¸è‡ªåŠ¨ç­‰åŒäºå…·å¤‡å¯å˜æ€§ã€‚ mut self: same as above, but the method can mutate the object. æ— æ¥æ”¶å™¨ï¼šè¿™å°†å˜ä¸ºç»“æ„ä½“ä¸Šçš„é™æ€æ–¹æ³•ã€‚é€šå¸¸ç”¨äºåˆ›å»ºæ„é€ å‡½æ•°ï¼ŒæŒ‰æƒ¯ä¾‹è¢«ç§°ä¸ºâ€œnewâ€ã€‚ å…³é”®ç‚¹ï¼š å¼•å…¥æ–¹æ³•æ—¶ï¼Œå°†æ–¹æ³•ä¸å‡½æ•°è¿›è¡Œæ¯”è¾ƒä¼šå¾ˆæœ‰å¸®åŠ©ã€‚ åœ¨æŸç§ç±»å‹ï¼ˆä¾‹å¦‚ç»“æ„ä½“æˆ–æšä¸¾ï¼‰çš„å®ä¾‹ä¸Šè°ƒç”¨æ–¹æ³•ï¼Œç¬¬ä¸€ä¸ªå‚æ•°å°†è¯¥å®ä¾‹è¡¨ç¤ºä¸ºâ€œselfâ€ã€‚ å¼€å‘è€…å¯èƒ½ä¼šé€‰æ‹©ä½¿ç”¨æ–¹æ³•ï¼Œä»¥ä¾¿åˆ©ç”¨æ–¹æ³•æ¥æ”¶å™¨è¯­æ³•å¹¶è®©æ–¹æ³•æ›´æœ‰æ¡ç†ã€‚é€šè¿‡ä½¿ç”¨æ–¹æ³•ï¼Œæˆ‘ä»¬å¯ä»¥å°†æ‰€æœ‰å®ç°ä»£ç ä¿å­˜åœ¨ä¸€ä¸ªå¯é¢„æµ‹çš„ä½ç½®ã€‚ æŒ‡å‡ºå…³é”®å­—â€œselfâ€çš„ç”¨æ³•ï¼Œå®ƒæ˜¯ä¸€ç§æ–¹æ³•æ¥æ”¶å™¨ã€‚ æ˜¾ç¤ºå®ƒæ˜¯â€œself: Selfâ€çš„ç¼©å†™æœ¯è¯­ï¼Œæˆ–è®¸è¦æ˜¾ç¤ºç»“æ„ä½“åç§°çš„å¯èƒ½ç”¨æ³•ã€‚ è¯´æ˜â€œSelfâ€æ˜¯â€œimplâ€å—æ‰€å±ç±»å‹çš„ç±»å‹åˆ«åï¼Œå¯ä»¥åœ¨å—ä¸­çš„å…¶ä»–ä½ç½®ä½¿ç”¨ã€‚ æŒ‡å‡ºâ€œselfâ€çš„ä½¿ç”¨æ–¹å¼ä¸å…¶ä»–ç»“æ„ä½“ä¸€æ ·ï¼Œå¹¶ä¸”å¯ä»¥ä½¿ç”¨ç‚¹è¡¨ç¤ºæ³•æ¥æŒ‡ä»£å„ä¸ªå­—æ®µã€‚ This might be a good time to demonstrate how the &self differs from self by trying to run finish twice. Beyond variants on self, there are also special wrapper types allowed to be receiver types, such as Box<Self>.

